const output = [];

for (const item of items) {
  // 1. Task verisini al
  const task = item.task || (item.json && item.json.task);

  // 2. Access Token verisini al
  const accessToken = item["input1.json->access_token"] || (item.json && item.json["input1.json->access_token"]);

  // 3. ID verisini al (Genellikle email message ID'sidir)
  const listId = item.id || (item.json && item.json.id);

  // 4. SADECE Task VARSA i≈ülem yap (Filtreleme)
  if (task) {

    // --- Tarih Formatlama Mantƒ±ƒüƒ± (Aynen korundu) ---
    if (task.due_date) {
      let originalDateValue = task.due_date;

      if (String(originalDateValue).toLowerCase() !== "null" && originalDateValue !== "") {
        try {
          const dateObject = new Date(originalDateValue);
          if (!isNaN(dateObject.getTime())) {
            task.due_date = dateObject.toISOString();
          } else {
            task.due_date = null;
          }
        } catch (e) {
          task.due_date = null;
        }
      } else {
        task.due_date = null;
      }
    }
    // ------------------------------------------------

    // 5. √áIKTI OLU≈ûTURMA
    // Task verilerini yay (...task), token'ƒ± ve id'yi ekle.
    output.push({
      ...task,               // title, description, due_date
      access_token: accessToken,
      id: listId             // ƒ∞steƒüiniz √ºzerine ID de eklendi
    });
  }
}

return output;
